import './Navigation.scss';

import PageLinks from './PageLinks';

export default function Navigation(props){
    return (
        <nav className={"Navigation.closed"}>
            <PageLinks navOpenState={props.navOpenState} pages={props.pages}/>
        </nav>
    );
}
